		// Init for list.
		$scope.initList = function() {
			if(typeof(listAllSelectPromise) === 'undefined') {
				var listAllSelectDefered = $q.defer();
				listAllSelectPromise = listAllSelectDefered.promise;
				listAllSelectDefered.resolve([]);
			}
			listAllSelectPromise.then(
				// Success.
				function(response) {
					// Get permission.
					userService.definePermissionByTarget($scope, 'material').then(
						// success.
						function(response) {
							// List data.
							$scope.listWithCriteriasByPage(1);
						},
						// error.
						function(reponse) {
							$scope.showMessageOnToast($translate.instant('clientwh_home_error'));
						}
					);
				},
				// Error.
				function(response) {
					
				}
			);
		}
		
		// Init for form.
		$scope.initForm = function(id) {
			if(typeof(listAllSelectPromise) === 'undefined') {
				var listAllSelectDefered = $q.defer();
				listAllSelectPromise = listAllSelectDefered.promise;
				listAllSelectDefered.resolve([]);
			}
			listAllSelectPromise.then(
				// Success.
				function(response) {
					$scope.createNew();
					$scope.idmaterial = id;
					$scope.material.id = id;
					if($scope.material.id > -1) {
						$scope.commentScope.idref = $scope.material.id;
						$scope.getById($scope.material.id);
					}
					
					// materialsub.
					$scope.materialsubScope.idref = $scope.material.id;
					
					// Attachment.
					$scope.attachmentScope.idref = $scope.material.id;
					$scope.listWithCriteriasByIdMaterialAndPage(id,1);
					$scope.frmDirty = false;
					$scope.ctlentityfieldType.items = [];
				},
				// Error.
				function(response) {
					
				}
			);
		}
		// Call service: list all for select.
		$scope.listAllForSelect = function() {
			var listAllSelectDeferred = $q.defer();
			// Init data for select.
			$scope.tmpType = [];
			$scope.catalogs = [];
			$scope.systems = [];
			$scope.origins = [];
			$scope.types = [];
			$scope.brands = [];
			$scope.units = [];
			$scope.specs = [];
			// Call service.
			var listCatalog = catalogService.listAllForSelectByScope('category');
			var listSystem = catalogService.listAllForSelectByScope('system');
			var listOrigin = catalogService.listAllForSelectByScope('origin');
			var listType = catalogService.listAllForSelectByScope('type');
			var listBrand = catalogService.listAllForSelectByScope('brand');
			var listUnit = catalogService.listAllForSelectByScope('unit');
			var listSpec = catalogService.listAllForSelectByScope('spec');
			// Response.
			$q.all([listCatalog,listSystem,listOrigin,listType,listBrand,listUnit,listSpec]).then(
				// Successes.
				function(responses) {
					$scope.ctlentityfieldCategory.items = responses[0].data;
					$scope.ctlentityfieldSystem.items = responses[1].data;
					$scope.ctlentityfieldOrigin.items = responses[2].data;
					//$scope.ctlentityfieldType.items = responses[3].data;
					$scope.tmpType =  responses[3].data;
					$scope.ctlentityfieldBrand.items = responses[4].data;
					$scope.ctlentityfieldUnit.items = responses[5].data;
					$scope.ctlentityfieldSpec.items = responses[6].data;
					// Resolve promise.
					listAllSelectDeferred.resolve(responses);
				},
				// Errors.
				function(responses) {
					$scope.showMessageOnToast($translate.instant('clientwh_home_error'));
					// Reject promise.
					listAllSelectDeferred.reject(responses);
				}
				
			);
			return listAllSelectDeferred.promise;
		}
		// Call and return a promise.
		listAllSelectPromise = $scope.listAllForSelect();
	
		
