	    	// Save.
			$scope.save = function () {
				$scope.resetValidateDuplicate(0);
				if($scope.ctlentityfieldType.selectedItem==null){
					$scope.frmMaterial.idtype.$invalid = true;
					$scope.frmMaterial.idtype.$touched = true;
				}
				if($scope.ctlentityfieldSpec.selectedItem==null){
					$scope.frmMaterial.idspec.$invalid = true;
					$scope.frmMaterial.idspec.$touched = true;
				}
				if($scope.ctlentityfieldBrand.selectedItem==null){
					$scope.frmMaterial.idbrand.$invalid = true;
					$scope.frmMaterial.idbrand.$touched = true;
				}
				if($scope.ctlentityfieldCategory.selectedItem==null){
					$scope.frmMaterial.idcategory.$invalid = true;
					$scope.frmMaterial.idcategory.$touched = true;
				}
				if($scope.ctlentityfieldOrigin.selectedItem==null){
					$scope.frmMaterial.idorigin.$invalid = true;
					$scope.frmMaterial.idorigin.$touched = true;
				}
				if($scope.ctlentityfieldSystem.selectedItem==null){
					$scope.frmMaterial.idsystem.$invalid = true;
					$scope.frmMaterial.idsystem.$touched = true;
				}
				if($scope.ctlentityfieldUnit.selectedItem==null){
					$scope.frmMaterial.idunit.$invalid = true;
					$scope.frmMaterial.idunit.$touched = true;
				}
				if ($scope.frmMaterial.$invalid) {
					$scope.frmMaterial.$dirty = true;
					$scope.frmDirty = true;	
					return;
				}
				$scope.showMessageOnToast($translate.instant('clientwh_home_saving'));
				var result;
				
				if ($scope.material.thumbnail==null) {
					$scope.material.thumbnail = "data:image/jpeg;base64,";
				}
				$scope.material.name = $scope.material.name.trim();
				if($scope.material.description != null)
					{$scope.material.description = $scope.material.description.trim();}				
				if ($scope.material.id > -1) {
					result = materialService.updateWithLock($scope.material.id, $scope.material);
				} 
				
				else {
					result = materialService.create($scope.material);
				}

				result
				// success.
				.then(function (response) {

					if (response.status === httpStatus.code.OK) {
						if($scope.material.id > -1) {
							$scope.material.version += 1;
						} else {
							$scope.material.version = 1;
						}
							$scope.material.id = response.data;
							// materialsub.
							$scope.materialsubScope.idref = $scope.material.id;
							// Attachment.
							$scope.attachmentScope.idref = $scope.material.id;
							
							$scope.showMessageOnToast($translate.instant('clientwh_home_saved'));
							// comment.
							$scope.commentScope.idref = $scope.material.id;
							$scope.listWithCriteriasByPage(1);
					} 
					else {
						if(response.data.code==clientwh.serverCode.EXISTCODE){
							$scope.frmMaterial.code.$error.duplicate = true;
						};
						if(response.data.code==clientwh.serverCode.EXISTNAME){
							$scope.frmMaterial.name.$error.duplicate = true;
						};
						if(response.data.code==clientwh.serverCode.EXISTALL){
							$scope.frmMaterial.code.$error.duplicate = true;
							$scope.frmMaterial.name.$error.duplicate = true;
						};
						$scope.showMessageOnToast($translate.instant('clientwh_home_fail'));
					}
				},

				// error.
					function (response) {
						$scope.showMessageOnToast($translate.instant('clientwh_home_error'));
					});
			}
		
