		$scope.getSort = function() {
			var result = [];
			// name.
			if(typeof($scope.sortKey) !== 'undefined' && $scope.sortKey !== ''){
				var order = 'desc';
		    	if($scope.reverse) {
		    		order = 'asc';
		    	}
		    	result.push('sort=' + $scope.sortKey + ',' + order);
			}
			// return.
			return result;
		}
		
		// Get search object.
		$scope.getSearch = function() {
			var result = [];

	    	result.push({ key: 'reftype', operation: '=', value: 'materialcode', logic: 'or' });
			// code.
		    if(typeof($scope.search.content) !== 'undefined' && $scope.search.content !== ''){
		    	result.push({ key: 'code', operation: 'like', value: $scope.search.content, logic: 'or' },
		    				{ key: 'name', operation: 'like', value: $scope.search.content, logic: 'or' });
		    }	    
		    // return.
		    return result;
		}
		
		
