	  //Reset validate duplicate
	    $scope.resetValidateDuplicate = function(number){
	    	switch (number) {
	    	case 1:
				if($scope.frmMaterial.code.$error.duplicate){
					delete $scope.frmMaterial.code.$error.duplicate;
					$scope.frmMaterial.code.$invalid = false;
					$scope.frmMaterial.code.$valid = true;
				}
				break;
			case 2:
				if($scope.frmMaterial.name.$error.duplicate){
					delete $scope.frmMaterial.name.$error.duplicate;
					$scope.frmMaterial.name.$invalid = false;
					$scope.frmMaterial.name.$valid = true;
				}
				break;
			default:
				if($scope.frmMaterial.code.$error.duplicate){
					delete $scope.frmMaterial.code.$error.duplicate;
					$scope.frmMaterial.code.$invalid = false;
					$scope.frmMaterial.code.$valid = true;
				}
				if($scope.frmMaterial.name.$error.duplicate){
					delete $scope.frmMaterial.name.$error.duplicate;
					$scope.frmMaterial.name.$invalid = false;
					$scope.frmMaterial.name.$valid = true;
				}
				break;
			}
	    }
		
    	
